import React, { Component } from "react";
import Footer from "../Footer";
import Header from "./Header";

export default class LoginPage extends Component {
  render() {
    return (
      <div>
        <Header></Header>
        <div class="container">
          <div className="welcome">
            <div>Welcome to MangaPunch </div>
            <div>Reading manga and conmmunicate with manga fans for free!</div>
          </div>
          <div className="not-a-memeber">
            <span>Not a member? </span><span><button></button></span>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}
